const Scroller = () => {
  const [items, setItems] = React.useState([{img:"https://scrunchnsmile.com/wp-content/uploads/2022/03/LOGO.jpeg",titleName:"SrunchNsmile",link: "https://scrunchnsmile.com",category: "Scrunchies",rating:5 , ratingCount:687 },{img:"data:image/jpeg;base64,",titleName:"SimplyScrunchy",link: "https://simplyscrunchy.com",category: "Scrunchies",rating:3 , ratingCount:366 },
  {img:"data:image/jpeg;base64,",titleName:"Hairlove",link: "https://hairloveindia.com/pages/categories",category: "Scrunchies",rating:4 , ratingCount:938 },
  {img:"data:image/png;base64,",titleName:"AtticSalt",link: "https://www.atticsalt.in/collections/scrunchies#whatmoreLive",category: "Scrunchies",rating:4 , ratingCount:638 }]);
  // => getItems(0, 10));

  // const [website,setWebsite] = React.useState([{img}])
  return (
    <MasonryInfiniteGrid
      loading={<div className="loading">Loading...</div>}
      onRequestAppend={(e) => {
        const nextGroupKey = (+e.groupKey || 0) + 1;

        e.wait();
        setTimeout(() => {
          e.ready();
          setItems([...items, ...getItems(nextGroupKey, 10)]);
        }, 1000);
      }}
    >
      {items.map((item) => (
        <Item
          data-grid-groupkey={item.groupKey}
          key={item.key}
          img={item.img}
          titleName= {item.titleName}
          link = {item.link}
          category={item.category}
          rating={item.rating}
          ratingCount={item.ratingCount}
        />
      ))}
    </MasonryInfiniteGrid>
  );
};
export default Scroller;
